// src/components/pages/Home.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // optional CSS file

export default function Home() {
  return (
    <div className="home-hero d-flex align-items-center justify-content-center text-white text-center">
      <div className="container">
        <h1 className="display-4 fw-bold">Hire Top Freelancers</h1>
        <p className="lead mb-4">Post your project and get work done efficiently.</p>
        <Link to="/login" className="btn btn-lg btn-primary">
          Get Started
        </Link>
      </div>
    </div>
  );
}
